      SELECT DISTINCT * FROM tab2 (FORMAT parquet) cor0 WHERE ( - col0 ) NOT BETWEEN CAST ( NULL AS INTEGER ) / + col0 * - 35 AND - + col1 / col2 * + col1;
  - name: tab2

outputs:
  - name: q2306.out
    data: |
      46	51	23
      64	77	40
